using XXXDeveloperTools.OracleToSnowflakeSqlConversions.ConversionDataModel;

namespace XXXDeveloperTools.OracleToSnowflakeSqlConversions.Mapper
{
    public class MappingEngine
    {
        private McKessonSchemas Schemas { get; set; }
        private List<OracleToSnowflakeColumnMap> AllColumnMaps { get; set; }

        public MappingEngine()
        {
            Schemas = new McKessonSchemas();
            AllColumnMaps = ReconcileOracleAndSnowflakeSchemas();
        }

        public JobToBeConvertedFromOracleToSnowflake GetColumnMaps(string sql, JobToBeConvertedFromOracleToSnowflake job)
        {
            List<OracleToSnowflakeColumnMap> sqlColumnMaps = new List<OracleToSnowflakeColumnMap>();
            List<string> alreadyReportedTables = new List<string>();
            sql = sql.Trim().ToUpper();
            string[] lines = sql.Split(new string[] { Environment.NewLine }, StringSplitOptions.None);
            McKessonSchemaNickName schemaNickName;
            string tableName = string.Empty;
            string tableAlias = string.Empty;

            foreach (var line in lines)
            {
                string[] sqlWords = line.Split(" ", StringSplitOptions.RemoveEmptyEntries);

                for (int i = 0; i < sqlWords.Length; i++)
                {
                    if (sqlWords[i].Trim('(').IndexOf("TREXONE_AUD_DATA.") == 0)
                    {
                        schemaNickName = McKessonSchemaNickName.AUD;
                        tableName = string.Empty;

                        if (i < sqlWords.Length)
                        {
                            string[] words = sqlWords[i].Split(".");
                            if (words.Length == 2)
                            {
                                if (!string.IsNullOrEmpty(words[1]) && (words[0].Trim('(').IndexOf("TREXONE_AUD_DATA") == 0))// || words[0].IndexOf("TREXONE_AUD_DATA") == 0))
                                {
                                    tableName = words[1].Trim(')');
                                }
                            }
                        }

                        if (!string.IsNullOrEmpty(tableName))
                        {
                            if (!alreadyReportedTables.Contains($"TREXONE_AUD_DATA.{tableName}"))
                            {
                                alreadyReportedTables.Add($"TREXONE_AUD_DATA.{tableName}");
                                Console.WriteLine($"{job.JobNumber},{job.SqlFileName},TREXONE_AUD_DATA,{tableName},TBD,WaitingForAccess");
                            }
                            /*
                            List<OracleToSnowflakeColumnMap> filteredMaps = AllColumnMaps.Where(x => x.OracleSchemaDetails.SchemaName == schemaNickName && x.OracleSchemaDetails.TableName == tableName).ToList();

                            if (filteredMaps.Count > 0)
                            {
                                foreach (var filteredmap in filteredMaps)
                                {
                                    if (sql.Contains(filteredmap.OracleSchemaDetails.ColumName))
                                    {
                                        sqlColumnMaps.Add(filteredmap);
                                        Console.WriteLine($"{job.JobNumber},{job.SqlFileName},TREXONE_AUD_DATA,{tableName},{filteredmap.OracleSchemaDetails.ColumName},WaitingForAccess");
                                    }
                                }
                            }
                            */
                        }
                    }

                    if (sqlWords[i].Trim('(').IndexOf("TREXONE_DW_DATA.") == 0)
                    {
                        schemaNickName = McKessonSchemaNickName.DW;
                        tableName = string.Empty;
                        tableAlias = string.Empty;

                        if (i < sqlWords.Length)
                        {
                            string[] words = sqlWords[i].Split(".");
                            if (words.Length == 2)
                            {
                                if (!string.IsNullOrEmpty(words[1]) && (words[0].Trim('(').IndexOf("TREXONE_DW_DATA") == 0))// || words[0].IndexOf("TREXONE_AUD_DATA") == 0))
                                {
                                    tableName = words[1].Trim(')');
                                }
                            }
                        }

                        if ((i + 1) < sqlWords.Length)
                        {
                            if (tableAlias != "=")
                                tableAlias = sqlWords[i + 1];
                        }

                        if (!string.IsNullOrEmpty(tableName))
                        {
                            //if (tableName == "FILL_FACT")
                            //{
                            //    Console.WriteLine("Found FILL_FACT");
                            //}

                            List<OracleToSnowflakeColumnMap> filteredMaps = AllColumnMaps.Where(x => x.OracleSchemaDetails.SchemaName == schemaNickName && x.OracleSchemaDetails.TableName == tableName).ToList();

                            if (filteredMaps.Count > 0)
                            {
                                foreach (var filteredmap in filteredMaps)
                                {
                                    //if (filteredmap.OracleSchemaDetails.ColumName == "RX_NUMBER")
                                    //{
                                    //    Console.WriteLine("Found RX_NUMBER");
                                    //}
                                    //if (!string.IsNullOrEmpty(tableAlias) && sql.Contains(tableAlias + "." + filteredmap.OracleSchemaDetails.ColumName))
                                    //{
                                    //    sqlColumnMaps.Add(filteredmap);
                                    //    Console.WriteLine($"{job.JobNumber},{job.SqlFileName},{tableName},{filteredmap.OracleSchemaDetails.ColumName},{!filteredmap.IsOracleColumNameDeprecatedInSnowflake}");
                                    //}
                                    //else 
                                    if (sql.Contains(filteredmap.OracleSchemaDetails.ColumName))
                                    {
                                        if (!alreadyReportedTables.Contains($"TREXONE_DW_DATA.{tableName}"))
                                        {
                                            alreadyReportedTables.Add($"TREXONE_DW_DATA.{tableName}");
                                            sqlColumnMaps.Add(filteredmap);
                                            Console.WriteLine($"{job.JobNumber},{job.SqlFileName},TREXONE_DW_DATA,{tableName},{filteredmap.OracleSchemaDetails.ColumName},{!filteredmap.IsOracleColumNameDeprecatedInSnowflake}");
                                        }
                                    }
                                }
                            }
                            //else
                            //{
                            //    Console.WriteLine($"Table not found = {tableName}");
                            //}
                        }
                    }
                }
            }

            job.ColumnMaps = sqlColumnMaps;
            return job;
        }

