        private List<OracleToSnowflakeColumnMap> ReconcileOracleAndSnowflakeSchemas()
        {
            List<OracleToSnowflakeColumnMap> allMaps = new List<OracleToSnowflakeColumnMap>();

            foreach(var oracleDetail in Schemas.OracleSchemaDetails)
            {
                OracleToSnowflakeColumnMap map = new OracleToSnowflakeColumnMap {
                    OracleSchemaDetails = oracleDetail,
                    IsOracleColumNameDeprecatedInSnowflake = !Schemas.SnowflakeSchemaDetails.Any(x => x.ColumName == oracleDetail.ColumName && x.TableName == oracleDetail.TableName && x.SchemaName == oracleDetail.SchemaName)
                };
                allMaps.Add(map);
            }

            return allMaps;
        }
    }
